import React from 'react';
import cx from 'classnames';
import img from './marketing.svg';
import style from './section.module.css';




const section = () => {
    return (
        <div>

        <div className={ cx(style.dFlex)}>
            <div>
            <h2> Conquiste Clientes!</h2>
             <p>Serviço bem feito merece visibilidade, faça seu negócio crescer conosco. 
                Seja visualizado e encontrado por milhares de clientes, converse, negocie e venda via chat, 
                cadastre-se e tenha acesso a esses e outros benefícios agora mesmo!</p> 

            </div>
            <div className={cx(style.radius)}><img src={img} alt="imagem para propaganda"/></div>

  </div>
        </div>

    )
}
export default section;
